const version="resound-003";const assets=["/","index.html","script.js","img/icon.png","img/sphere-down.png","img/sphere-up.png","splide/splide.min.css","splide/splide.min.js"];self.addEventListener("install",(e=>e.waitUntil(install())));self.addEventListener("activate",(e=>e.waitUntil(activate())));self.addEventListener("fetch",(e=>e.respondWith(performFetch(e.request))));async function install(){console.log("@install");const cache=await caches.open(version);await cache.addAll(assets)}async function activate(){console.log("@activate");for(const key of await caches.keys()){if(key!==version)await caches.delete(key)}}async function performFetch(request){console.log("@fetch",request.url);let response=await caches.match(request);if(response)response;return fetch(request)}